  assemblies:
  - dotNetRDF
  namespace: VDS.RDF.Nodes
  summary: "\nInterface for Valued Nodes.\n"
  remarks: "\n<p>\nThis interface extends the basic <xref href=\"VDS.RDF.INode\" data-throw-if-not-resolved=\"false\"></xref> interface with methods related to turning the lexical value into a strongly typed .Net value.  It is intended primarily for use within SPARQL expression evaluation where we need to do a lot of value conversions and currently waste a lot of effort (and thus performance) doing that.\n</p>\n"
  example: []
  syntax:
    content: 'public interface IValuedNode : INode, IComparable<INode>, IComparable<IBlankNode>, IComparable<IGraphLiteralNode>, IComparable<ILiteralNode>, IComparable<IUriNode>, IComparable<IVariableNode>, IEquatable<INode>, IEquatable<IBlankNode>, IEquatable<IGraphLiteralNode>, IEquatable<ILiteralNode>, IEquatable<IUriNode>, IEquatable<IVariableNode>, ISerializable, IXmlSerializable'
    content.vb: >-
      Public Interface IValuedNode
          Inherits INode
